import React, { Component } from "react";

class LatestArticle extends Component {
  state = {};
  render() {
    return (
      <div>
        <div style={{ height: 20, width: 20, backgroundColor: "black" }}>
          <span style={{ position: "relative", right: 20 }}>Featured</span>
        </div>
      </div>
    );
  }
}

export default LatestArticle;
